import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

const App = () => <div className="text-center text-2xl">Welcome to File Upload App</div>;

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
